import React, { useEffect, useState } from 'react';
import axios from 'axios'
import { Link } from 'react-router-dom';
import '../App.css';
import Background from '../Pages/Images/Back.png';

function Form() {

  const [productName, setProductName] = useState();
  const [productPrice, setProductPrice] = useState();
  const [productStock, setProductStock] = useState();
  const [productCategory, setProductCategory] = useState();

  const [products, setProducts] = useState([]);

  const style = {
    margin: "10px",
  }

  const addProduct = (e) => {
    let payload = { name: productName, price: productPrice, stock: productStock, category: productCategory }
    axios.post('http://localhost:5000/api/form', payload)
      .then()
      .catch()

  }

  useEffect(() => {
    axios.get('http://localhost:5000/api/form/')
      .then((res) => {
        setProducts(res.data)
      })
      .catch()
  })

  const handleDelete = (id) => {
    axios.delete('http://localhost:5000/api/form/' + id)
  }

  return (

    <div style={{ backgroundImage: `url(${Background})`, backgroundSize: '1481px', width: '1481px', height: '2000px', marginTop: '-20px', backgroundRepeat: 'no-repeat', backgroundColor: 'black' }} className="FormBack">
      <h1 className="Info NeonText" style={{ position: 'absolute', top: '200px', marginLeft: '100px' }}>NEW PRODUCTS</h1>
      <form onSubmit={addProduct}>
        <div className="form">
          <h1 style={{ color: 'white', fontWeight: '10%', fontSize: '30px', marginBottom: '20px' }} >Add Products</h1>
          <div >
            <input style={{ width: '700px', height: '50px', borderRadius: '5px', border: '1px solid white', backgroundColor: 'black', color: 'white', paddingLeft: '15px', marginBottom: '30px' }}
              type="text"
              placeholder="Product Name"
              onChange={(e => setProductName(e.target.value))}
            />
            <input style={{ width: '700px', height: '50px', borderRadius: '5px', border: '1px solid white', backgroundColor: 'black', color: 'white', paddingLeft: '15px', marginBottom: '30px' }}
              type="number"
              placeholder="Price"
              onChange={(e => setProductPrice(e.target.value))}
            />
            <input style={{ width: '700px', height: '50px', borderRadius: '5px', border: '1px solid white', backgroundColor: 'black', color: 'white', paddingLeft: '15px', marginBottom: '30px' }}
              type="number"
              placeholder="Stock"
              onChange={(e => setProductStock(e.target.value))}
            />
            <input style={{ width: '700px', height: '50px', borderRadius: '5px', border: '1px solid white', backgroundColor: 'black', color: 'white', paddingLeft: '15px', marginBottom: '30px' }}
              type="text"
              placeholder="Category"
              onChange={(e => setProductCategory(e.target.value))}
            />
            <button className='button10' type='submit' style={style}>Add Product</button>
          </div>
        </div>
      </form>

      <div style={{width: '1300px', marginTop: '-350px'}} class="card cardAdmin mx-auto">
        <div class="card-header">
          Product Information
        </div>
        <div class="card-body">
          <table style={{width: '1200px'}} class="table">
            <thead>
              <tr>
                <th>Product Name</th>
                <th>Price</th>
                <th>Stock</th>
                <th>Category</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {products.map(product => {
                return (
                  <tr key={product._id}>
                    <td>{product.name}</td>
                    <td>{product.price}</td>
                    <td>{product.stock}</td>
                    <td>{product.category}</td>
                    <td>
                      <Link to={`/update/${product._id}`} class="btn btn-sm btn-success me-2">Update</Link>
                      <button class="btn btn-danger" onClick={() => handleDelete(product._id)}>Delete</button>
                    </td>
                  </tr>
                )
              })}
            </tbody>
          </table>
        </div>
      </div>

    </div>
  );
}

export default Form;
